import React from 'react';
import Todos from './components/Todos';

function App() {
  state = {
    todos: [
      {
        id:1,
        title: 'Take out trash',
        completed: false
      },
      {
        id:2,
        title: 'Go home',
        completed: false
      },
      {
        id:3,
        title: 'Do chores',
        completed: false
      }
    ]
  }


  return (
    <div className="App">
      <Todos />
    </div>
  );
}

export default App;
